import "./InvoiceHeader.css"

const InvoiceHeader=(props)=>
{
    console.log(props.getBusinessInfo[0].businessName);

    return(
            <div className="inv-wdthgt inv-border inv-float ">
                <div className='inv-divlabel'><label className="inv-label">{props.getBusinessInfo}}</label></div>
            </div>
    )
}
export default InvoiceHeader;
